DROP TABLE IF EXISTS `list_contracts`;
CREATE TABLE `list_contracts` (
  `id_contracts` bigint(20) unsigned NOT NULL,
  `status` enum('created','signature','concluded','executed','dispute','dissolve') COLLATE utf8_unicode_ci DEFAULT NULL,
  KEY `id_contracts` (`id_contracts`),
  CONSTRAINT `list_contracts_ibfk_1` FOREIGN KEY (`id_contracts`) REFERENCES `form_contracts` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `form_contracts`;
CREATE TABLE `form_contracts` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `client_id` bigint(20) unsigned NOT NULL,
  `executor_id` bigint(20) unsigned NOT NULL,
  `header_doc` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `contract` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `start_work` datetime DEFAULT NULL,
  `end_work` datetime DEFAULT NULL,
  `price` int(10) DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `header_doc` (`header_doc`),
  KEY `client_id` (`client_id`),
  KEY `executor_id` (`executor_id`),
  CONSTRAINT `form_contracts_ibfk_1` FOREIGN KEY (`client_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `form_contracts_ibfk_2` FOREIGN KEY (`executor_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `form_disputes`;
CREATE TABLE `form_disputes` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `applicant_id` bigint(20) unsigned NOT NULL,
  `respondent_id` bigint(20) unsigned NOT NULL,
  `contract_id` bigint(20) unsigned NOT NULL,
  `dispute_text` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `dispute_price` int(10) DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `applicant_id` (`applicant_id`),
  KEY `respondent_id` (`respondent_id`),
  KEY `contract_id` (`contract_id`),
  CONSTRAINT `form_dispute_ibfk_1` FOREIGN KEY (`applicant_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `form_dispute_ibfk_2` FOREIGN KEY (`respondent_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `form_dispute_ibfk_3` FOREIGN KEY (`contract_id`) REFERENCES `form_contracts` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



